import math

def is_prime(n):
    if n <= 2:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def unique_prime_numbers(numbers):
    primes = set()
    for num in numbers:
        if isinstance(num, float):
            num = round(num)
        if isinstance(num, int) and num > 0 and is_prime(num):
            primes.add(num)
    return primes

